import React from 'react';

const Search = (placeHolder) => {
    return (
        <div className="input-group mb-3">
            <input type="text" className="form-control" placeholder={placeHolder} aria-label={placeHolder} aria-describedby="basic-addon1"></input>
        </div>
    );
}

export default Search;
